Copiei esse resumo acho que em 2018👇

Existe um DECRETO elaborado por FERNANDO HENRIQUE CARDOSO e sancionado por LUIZ INÁCIO LULA DA SILVA. 

“Esse Plano que está ai, PNDH3 assinado por Lula no Decreto Lei No. 7.037 de 21/12/2010 e intitulado capciosamente de PLANO NACIONAL DE DESENVOLVIMENTO HUMANO, são 521 propostas com 6 EIXOS ORIENTADORES, para reformular por inteiro a DEMOCRACIA BRASILEIRA! O grande DRAMA desse plano é que é um modelo MUITO SEMELHANTE AO MODELO VENEZUELANO, segundo Dr. IVES GANDRA MARTINS, um dos maiores juristas constitucional do Brasil

1)A quebra do EQUILÍBRIO entre os 3 PODERES do Brasil, colocando o Judiciário, o Legislativo e até mesmo o Ministério Público, sujeitos ao EXECUTIVO. 

Obs. Quanto a esse primeiro item, hoje, nesse final de junho de 2019, observa-se que curiosamente, talvez devido não terem conseguido ELEGER O CANDIDATO ESQUERDISTA, inverteram e estão dando um jeito de fazer o OPOSTO.

Abaixo o resumo do PLANO transformado em DECRETO.

2) Lá estão explicitados os planos para: 

a) desarmar a população ; 
b) Perverter as crianças nas escolas; 
c) legalizar o aborto; 
d) legalizar a prostituição como profissão ( expresso assim na lei: "desconstruir os estereótipos relativos aos profissionais do sexo através de campanhas educativas"); 
e) perda de direito à propriedade; 
f) colocar a Polícia Militar como força reserva do Exército; 
g) no eixo orientador IV, diretriz 17 reza: "realizar ações permanentes de estímulo ao desarmamento da população." h) no eixo orientador V, diretriz 22 do supracitado Decreto lemos: "propor a criação do MARCO LEGAL, regulamentando o Art 221 da CF( CENSURA E CONTROLE DA IMPRENSA E INTERNET ), à semelhança das ditaduras cubana, venezuelana e chinesa, onde quem controlam a Web é o Estado! Se você ficou chocado com tudo que foi falado até acima, a pior parte vem agora: Esse PNDH3, no seu eixo orientador V, diretrizes 18 a 22 propõem:

 "Implantar literalmente uma REVOLUÇÃO CULTURAL NO BRASIL, onde todos os PROFESSORES serão conclamados a seguir RIGOROSAMENTE o Plano; essa revolução cultural já está em andamento há quase 40 anos, através da DOUTRINAÇÃO ideológica de viés MARXISTA, empreendida nas UNIVERSIDADES, escolas do ensino fundamental e médio de todo o Brasil, com o auxílio da grande imprensa, ARTISTAS e INTELECTUAIS! A INTENÇÃO DESSE PLANO intitulado PNDH3 é aniquilar nossa Democracia transformando o país num regime totalitário bolivariano, a exemplo do que assistimos hoje na Venezuela do ditador Maduro!

😳
Imagine a situação de quem fez essa porcaria com medo dessa lei assinada pelo presidente Bolsonaro na época.. 
III - determinação de realização compulsória de:
a) exames médicos;
b) testes laboratoriais;
c) coleta de amostras clínicas;
d) vacinação e outras medidas profiláticas; ou    (Vide ADPF nº 754)
e) tratamentos médicos específicos;

Se vir algum idólatra dizendo que não está valendo hoje, agora, não importa! na época era válida e essa lei está na gaveta nesse momento podendo ser usada por qualquer avatar político que entrar no cargo, quem realmente manda neles vai mandar usar imediatamente em nome de um bem coletivo imaginário.

Eu analiso oque as pessoas fazem, não oque elas falam… falar por falar até papagaio 🦜 fala oque ele conseguir replicar.


